import React from "react";

function TextEditor() {
	return (
		<div>
			<div className="mb-3 me-5 ms-5 mt-10">
				<label htmlFor="exampleFormControlTextarea1" className="form-label">
					Example textarea
				</label>
				<textarea
					className="form-control"
					id="exampleFormControlTextarea1"
					rows="10"
				></textarea>
			</div>
		</div>
	);
}

export default TextEditor;
